import {useRef} from "react"

export default function ClickCounter(){
    const clickCount = useRef(0)

    const handleClick = () => {
        clickCount.current++
        console.log("Kliknięć:", clickCount.current)
    }

    return <button onClick={handleClick}>Kliknij</button>
}
